public synchronized RejectionReason getReason() {
  YarnProtos.RejectedSchedulingRequestProtoOrBuilder p =
      viaProto ? proto : builder;
  if (!p.hasReason()) {
    return null;
  }
  return ProtoUtils.convertFromProtoFormat(p.getReason());
}
